	public static class Result {
		private String timestamp;
		private double highest_bid;
		private double lowest_ask;
		private double opening_price;
		private double closing_price;
		private long volume;
		private double recent_average_price;
		public String getTimestamp() {
			return timestamp;
		}
		public void setTimestamp(String timestamp) {
			this.timestamp = timestamp;
		}
		public double getHighest_bid() {
			return highest_bid;
		}
		public void setHighest_bid(double highest_bid) {
			this.highest_bid = highest_bid;
		}
		public double getLowest_ask() {
			return lowest_ask;
		}
		public void setLowest_ask(double lowest_ask) {
			this.lowest_ask = lowest_ask;
		}
		public double getOpening_price() {
			return opening_price;
		}
		public void setOpening_price(double opening_price) {
			this.opening_price = opening_price;
		}
		public double getClosing_price() {
			return closing_price;
		}
		public void setClosing_price(double closing_price) {
			this.closing_price = closing_price;
		}
		public long getVolume() {
			return volume;
		}
		public void setVolume(long volume) {
			this.volume = volume;
		}
		public double getRecent_average_price() {
			return recent_average_price;
		}
		public void setRecent_average_price(double recent_average_price) {
			this.recent_average_price = recent_average_price;
		}
	}

	private List<Result> results;

	public void setResult(List<Result> results) {
		this.results = results;
	}
	
	public List<Result> getResult() {
		return results;
	}
	
	private static final String COMMAND = "blockchain_market_price_history";
	
	public static CommandJson test(String quoteAssetSymbol, String baseAssetSymbol, String startTime, long duration, HistoryGranularity granularity) {
		return doTest(COMMAND, new Object[] { quoteAssetSymbol, baseAssetSymbol, startTime, duration, granularity.toString() });
	}
	
	public static List<BlockchainMarketPriceHistory.Result> run(String quoteAssetSymbol, String baseAssetSymbol, String startTime, long duration, HistoryGranularity granularity) throws BTSSystemException {
		return run(0, quoteAssetSymbol, baseAssetSymbol, startTime, duration, granularity);
	}
	public static List<BlockchainMarketPriceHistory.Result> run(int id, String quoteAssetSymbol, String baseAssetSymbol, String startTime, long duration, HistoryGranularity granularity) throws BTSSystemException {
		BlockchainMarketPriceHistory i = (BlockchainMarketPriceHistory) new BlockchainMarketPriceHistory().doRun(
				id, COMMAND, new Object[] { quoteAssetSymbol, baseAssetSymbol, startTime, duration, granularity.toString() });
		i.checkSystemException();
		return i.getResult();
	}
	
